  return (
  <>
    <Navbar />
    {/* <!-- Button trigger modal --> */}

    <div class="row g-3 align-items-center">
      <div class="col-auto">
        <label for="display" class="col-form-label">Display Name</label>
      </div>

      <div class="col-auto">
      <input type="text" class="form-control" id="display"/>
      </div>

      <div class="col-auto">
      <button type="button" class="btn btn-primary" onClick={() => {}}>Update</button>
      </div>
    </div>

    <div class="row g-3 align-items-center">
      <div class="col-auto">
        <label for="display" class="col-form-label">Password</label>
      </div>

      <div class="col-auto">
      <input type="text" class="form-control" id="display"/>
      </div>

      <div class="col-auto">
      <button type="button" class="btn btn-primary" onClick={() => {}}>Update</button>
      </div>
    </div>
  </>
  );
}

export default Account;
